import UsersIcon from '../../assets/icons/users.png';
import MailIcon from '../../assets/icons/mail.png';
import { newUser } from "../../services/api";
import { toastError, toastSuccess } from "../../utils/toast";
import { Toaster } from "react-hot-toast";

export default function Maps() {
  const [permissions, setPermissions] = useState([
    'Eletroterapia', 'Ultrasom Estético', 'Radiofreqüência Estética', 'Laserterapia', 'Peelings químicos e Mecânicos', 'Carboxiterapia', 'Intradermoterapia', 'Aplicação de toxina botulínica','preenchimentos na derme','Fios de sustentação'
  ])

  const [name, setName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');

  const [isLoading, setIsLoading] = useState(false);

  

  return (
    <><CreateUserWrapper>
                  <Toaster position="top-right" reverseOrder={false} />
                  <br></br>
                  <br></br>

                  <br></br>
                  <h3>Veja como nos encontrar</h3>

                  <br></br>
                          <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3541.3016797941073!2d-48.45897572372736!3d-27.428707414962403!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x95274335f5d4efc5%3A0x2e590e8302888a9f!2sOrdem%20Arte%20Tattoo!5e0!3m2!1spt-BR!2sbr!4v1684525279243!5m2!1spt-BR!2sbr" width="600" height="450" style="border:0;" allowfullscreen="" loading="lazy" referrerpolicy="no-referrer-when-downgrade"></iframe>
                 

        


    </CreateUserWrapper>  </>
  )
}
